import React from "react";
import Header from "./../Header";
import Menu from "./../Menu";


class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      name: '',
    };
  }

  handleChange() {
    this.setState({
      name: 'dfhjdh'
    });
  }

  render() {
      return (
            <div className="XYZ">
              <div className="menu">
              <p>{this.state.name}</p>
              <input type="text" onChange={this.handleChange} />
                <Header>
                  <div><Menu /></div>
                </Header>
              </div>
            </div>
      );
    }
}

export default App;
